namespace BLOG.DataAccess.Seed
{
    using BLOG.Entities;
    using Microsoft.EntityFrameworkCore;

    using System.Collections.Generic;
    using System.Linq;
    using System.Threading.Tasks;

    public class ImageSeed : IContextSeed
    {
        public ImageSeed(BlogContext context)
        {
            this.Context = context;
        }

        public BlogContext Context { get; set; }

        public async Task Execute(bool isProduction)
        {
            if (!this.Context.Images.Any() && this.Context.Articles.Any() && !isProduction)
            {
                List<ArticleEntity> articles = await this.Context.Articles.ToListAsync();

                ImageEntity imageEntity = new ImageEntity()
                {
                    Placeholder = "Thumbnail",
                    Base64Image = "data:image/png;base64,",
                    IsThumbnail = true,
                    ArticleEntityId = articles.First().Id,
                };

                ImageEntity imageEntity2 = new ImageEntity()
                {
                    Placeholder = "MonImage1",
                    Base64Image = "data:image/png;base64,",
                    IsThumbnail = false,
                    ArticleEntityId = articles.First().Id,
                };

                await this.Context.Images.AddRangeAsync(new List<ImageEntity>() { imageEntity, imageEntity2 });
                await this.Context.SaveChangesAsync();
            }
        }
    }
}